import styled from 'styled-components'

export const Container = styled.div`
  background-color: #ffffff;
  min-height: 100vh;
  max-height: 100%;
  padding: 0 20%;
  @media (min-width: 320px) and (max-width: 425px) {
    padding: 5px;
  }
`
